import React from 'react';
import Button from '@mui/material/Button';
import { CButton } from '@coreui/react';
import './App.css';

class Header extends React.Component {
    render() {
        return (
            <header className="App-header">
                <div>
                <CButton color="secondary" variant="ghost">Shortly</CButton>
                <CButton color="secondary" variant="ghost">Features</CButton>
                <CButton color="secondary" variant="ghost">Pricing</CButton>
                <CButton color="secondary" variant="ghost">Resources</CButton>

                </div>
                <div>
                    <CButton color="secondary" variant="ghost">Login</CButton>
                    <Button className="sign-up-btn" variant="contained">Sign Up</Button>
                </div>
            </header>
        );
    }
}

export default Header;
